(1320, 'http://www.bbc.com/news/world-africa-44397314', 'https://ichef.bbci.co.uk/news/320/cpsprodpb/72CF/production/_101919392_gettyimages-967066010.jpg', 'A picture taken on June 3, 2018, shows a dog siting by heaps of plastic waste at Kibarani dump site in Mombasa. On June 5, 2018 the United Nations mark the World Environment Day which plastic pollution is the main theme this year.', '', 0, 0),
(1321, 'http://www.bbc.com/news/world-africa-44397314', 'https://ichef.bbci.co.uk/news/320/cpsprodpb/A2DB/production/_101919614_gettyimages-965181016.jpg', 'Members of Kenya police Band perform during the celebration of Madaraka day, a day celebrating Kenya\'s attainment of internal self-rule in 1963, in Kisumu, Kenya, on June 1, 2018.', '', 0, 0),
