(1323, 'http://www.bbc.com/news/world-africa-44397314', 'https://ichef.bbci.co.uk/news/320/cpsprodpb/D559/production/_101871645_4ce5ce9400000578-5802767-image-a-14_1528101024334.jpg', 'Tunisia\'s goalkeeper Mouez Hassen lays on the ground', '', 0, 0),
(1324, 'http://www.bbc.com/news/world-africa-44397314', 'https://ichef.bbci.co.uk/news/320/cpsprodpb/28C0/production/_101923401_tv047185432.jpg', 'This handout image received from French Photographer Alexis Rosenfeld on June 1, 2018 shows clownfish swimming amongst coral reefs off the coast of the French overseas territory of Mayotte, in the Comoros Archipelago of the Indian Ocean. The work of photographer Alexis Rosenfeld, who spent 400 hours under water in two years taking pictures to highlight the threatened coral reefs and their importance for humanity, will be exhibited on the fence of UNESCO in Paris until August 30, 2018.', '', 0, 0),
(1325, 'http://www.bbc.com/news/world-africa-44397314', 'https://ichef.bbci.co.uk/news/320/cpsprodpb/13F1B/production/_101919618_gettyimages-968691672.jpg', 'Clara Maitse, 77, a former illegal miner in Kimberley, 5 June 2018', '', 0, 0),
(1326, 'http://www.bbc.com/news/world-africa-44397314', 'https://ichef.bbci.co.uk/news/320/cpsprodpb/8234/production/_101923333_hi047277279.jpg', 'A man holds rough diamonds found by former illegal, now independent, miners, on June 5, 2018 in Kimberly, Northern Cape, South Africa. Unlike formal mining operations, small-scale miners pan for precious minerals around the edge of established quarries in the hope of coming up lucky. In April, some 800 illicit miners received licences to operate on a vast tract of land near Kimberley in the country\"s centre. The landmark deal was aimed at curbing the rapid growth of illegal mining which has been spurred on ', '', 0, 0),
(1327, 'http://www.bbc.com/news/world-africa-44397314', 'https://ichef.bbci.co.uk/news/320/cpsprodpb/76E0/production/_101923403_hi047174961.jpg', 'Actors play two red berret soldiers with assault rifles searching for innocent civilians who have deserted their homes hiding in the thick bush on June 2, 2018, in Harare, as they take part in a scene from a play \"1983 the Dark Years\", which portrays the life of a young girl affected by the Gukurahundi events in the 1980s when human rights atrocities were perpetrated by the Zimbabwe National Army deployed to put down a dissident military group in the Matebeleland region of the country.', '', 0, 0),
(1328, 'http://www.bbc.com/news/world-africa-44397314', 'https://ichef.bbci.co.uk/news/320/cpsprodpb/58A3/production/_101919622_hi047246331.jpg', 'A dancer performs during the Cape Town City Ballet lunch hour concert at the Artscape theatre in Cape Town, South Africa 05 June 2018. The free concert showcased dances from many different ballets including the Cabaret Club, Romeo and Juliette, Giselle and the Nutcracker.', '', 0, 0),
