(4503, 'http://www.bbc.com/cbbc/joinin/hetty-feather-diary-episode-5', 'https://childrens-binary.files.bbci.co.uk/childrens-binarystore/cbbc/Unlocked-Week-5.gif', 'A young girl carrying a tray while a girl stands next to her looking expectant - a book opens to show the words \'Dear Diary\'.', '', 0, 0),
(4504, 'http://www.bbc.com/cbbc/joinin/hetty-feather-diary-episode-5', 'https://childrens-binary.files.bbci.co.uk/childrens-binarystore/cbbc/what-are-you-most-proud-of-about-yourself-5.gif', 'A sudden hand written note, splashed with ink, saying \'What are you most proud of about yourself?\'', '', 0, 0),
(4505, 'http://www.bbc.com/cbbc/joinin/hetty-feather-diary-episode-5', 'https://ichef.bbci.co.uk/childrens-responsive-ichef-live/r/400/1x/cbbc/sisters-reply-1.jpg', 'Hetty Feather replies: Book reader dancer: Dear Hetty, Like you, I also want to become a writer. I am proud of my writing skills and I\'m proud that I can read and write, follow my dreams, without worrying about who my family are or where I come from because no I matter who I am, I will always be a writer. Yours, Book Reader Dancer. Hetty Feather: Dear Book reader dancer, Thank you for your letter. You sound like you\\u2019re following your dreams! I love writing because it lets me escape and captures my thou', '', 0, 0),
(4506, 'http://www.bbc.com/cbbc/joinin/hetty-feather-diary-episode-5', 'https://ichef.bbci.co.uk/childrens-responsive-ichef-live/r/400/1x/cbbc/sisters-reply-2.jpg', 'Hetty Feather replies: Tomboy_Georgie: I\\u2019m dyslexic and proud  It means that I really struggle reading and writing, but I love to read.  I\\u2019m proud that I was able to give a speech in a assembly about dyslexia and even though I made mistakes and jumbled my words up I picked myself up and continued with my head high.  I\\u2019m even working with my school to write about my experience with dyslexia. Hetty Feather: Dear Tomboy_Georgie, Thank you for your letter. Making a speech sounds wonderful! I thin', '', 0, 0),
(4507, 'http://www.bbc.com/cbbc/joinin/hetty-feather-diary-episode-5', 'https://ichef.bbci.co.uk/childrens-responsive-ichef-live/r/400/1x/cbbc/sisters-reply-3.jpg', 'Hetty Feather replies: Golden Snidget: I am most proud of my parents, because when I\'m being obnoxious, rude, mean, spiteful or unkind, they still love me, care for me, help me cope with my feelings and understand where they come from. I\'d love them to know how much I feel grateful for. Hetty Feather: Dear Golden Snidget, Thank you for your letter. Family and friends are very important to me too! And I\\u2019ve been rude and got my friends into trouble but if I apologise, we stay friends just the same. Well,', '', 0, 0),
(4508, 'http://www.bbc.com/cbbc/joinin/hetty-feather-diary-episode-5', 'https://ichef.bbci.co.uk/childrens-responsive-ichef-live/r/400/1x/cbbc/sisters-reply-4.jpg', 'Hetty Feather replies: ImaginePonies: I am most proud of my braveness. I have a disability which makes me shy, but i love performing in front of people. Hetty Feather: Dear Imagine Ponies, Thank you for your letter. I\\u2019m so glad you like performing in front of people, especially if you\\u2019re shy! I\\u2019d love to do that \\u2013 but have never had the chance. Instead, I write lots and speak up for others. That\\u2019s what makes me brave too \\u2013 just like you! Yours Hetty Feather. ', '', 0, 0),
(4509, 'http://www.bbc.com/cbbc/joinin/hetty-feather-diary-episode-5', 'https://ichef.bbci.co.uk/childrens-responsive-ichef-live/r/400/1x/cbbc/sisters-reply-5.jpg', 'Hetty Feather replies: amelia_slytherin: dear hetty..  i am most proud of my education, to see where i am after all those years of studying hard, i am also grateful for many other things too though. Hetty Feather: Dear amelia_slytherin, Thank you for your letter. You\\u2019re right \\u2013 education is so important! I hated the Foundling Hospital, but I loved learning. I wish I could study more but I\\u2019m too busy being a servant! And imagine what Lady Grenford would say if she caught me with a book! Yours ', '', 0, 0),
(4510, 'http://www.bbc.com/cbbc/joinin/hetty-feather-diary-episode-5', 'https://ichef.bbci.co.uk/childrens-responsive-ichef-live/r/400/1x/cbbc/sisters-reply-6.jpg', 'Hetty Feather replies: U17011673: I am most proud of my friend because she has an illness and she has to have her operation in a few weeks and she is being really brave. Hetty Feather: Dear U17011673, Thank you for your letter. Your friend certainly does sound brave! And you must be a good person for being so proud of her. That\\u2019s what makes me happy \\u2013 having good friends. I can rely on them and they can rely on me! Good luck to your brave friend too! Yours Hetty Feather. ', '', 0, 0),
(4511, 'http://www.bbc.com/cbbc/joinin/hetty-feather-diary-episode-5', 'https://ichef.bbci.co.uk/childrens-responsive-ichef-live/r/400/1x/cbbc/sisters-reply-7.jpg', 'Hetty Feather replies: U16991097: Dear Hetty,  I\\u2019m proud of my willingness to talk to people and take risks as I wear a hearing aid which helps me to hear better. I\\u2019m also very happy that I\\u2019m a kind person who is always happy! Hetty Feather: Dear U16991097, Thank you for your letter. I love happy people! They make me happy too. I think you have lots of courage too \\u2013 which is so important, as well as being kind. Not that I\\u2019d be kind to anyone like Brody or Lady Grenford! They don\\u20', '', 0, 0),
