(1583, 'http://www.bbc.com/future/story/20180604-the-cameras-that-examine-your-gut', 'BBC - Future - The cameras that examine your gut', 'Wireless technology has enabled doctors to give patients a tiny camera in pill form. This camera pill is swallowed and provides a less invasive way of checking the digestive system.', 'story, STORY, story, video, future-video, , life-connected', 0),
(1584, 'http://www.bbc.com/future/columns/space-station', 'BBC - Future - Space Station', 'Tales from the new space race. Broadcaster and self-confessed space nerd Richard Hollingham gives a personal view from mission control, exploring manâ€™s continued obsession with the final frontier.', 'column-index, space-station', 0),
