(1588, 'http://www.bbc.com/future/story/20180531-where-are-the-worlds-healthiest-places-to-live', 'BBC - Future - Is it really healthier to live in the countryside?', 'We often think of cities as the least healthy places to live. But what does the research say? From mountaintop to metropolis, BBC Future analyses how our location affects wellbeing.', 'story, STORY, story, image, health, ', 0),
