(1590, 'http://www.bbc.com/future/story/20180531-the-wwi-tank-that-helped-change-warfare-forever', 'BBC - Future - The WWI tank that helped change warfare forever', 'On 31 May 1918, a small tank designed by a famous French car maker and a brilliant army officer saw its first action. Its inspired design lives on in today\'s tanks, 100 years later.', 'story, STORY, story, slideshow, weapon, ', 0),
(1591, 'http://www.bbc.com/future/story/20180530-is-cold-water-swimming-worth-the-sacrifice', 'BBC - Future - Is cold-water swimming worth the sacrifice?', 'Cold-water swimmers routinely experience brain freeze, numb hands, tingling limbs and incredible adrenaline rushes. But, is cold-water swimming worth the rush?', 'story, STORY, story, video, body-of-evidence,future-video, ', 0),
(1592, 'http://www.bbc.com/future/story/20180530-the-controversial-debut-of-genes-in-criminal-cases', 'BBC - Future - The controversial debut of genes in criminal cases', 'Lawyers have begun using people\'s genetic history to help defend their clients â€“ will it actually influence judges and juries?', 'story, STORY, story, image, crime, , criminal-myths', 0),
(1593, 'http://www.bbc.com/future/story/20180523-how-gender-bias-affects-your-healthcare', 'BBC - Future - \'Everybody was telling me there was nothing wrong\'', 'Women are more likely to wait longer for a health diagnosis and to be told itâ€™s â€˜all in their headsâ€™. That can be lethal: diagnostic errors cause 40,000-80,000 deaths in the US alone.', 'story, STORY, story, image, medicine, , health-gap', 0),
