(2946, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Nino_Farina.html', 'Nino Farina - 1950', 'The first ever Formula One World Champion came from a privileged background and had a stylish driving technique that was adopted by many drivers. A hard and determined racer, Farina relied on a combination of profound self belief and raw courage to compensate for the superior skills possessed by many of his more naturally talented opponents. Yet he also drove recklessly and few Formula One drivers ever competed with such apparent disregard for their personal safety. Somehow surviving an accident-strewn raci', '', 0),
(2947, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Juan_Manuel_Fangio.html', 'Juan Manuel Fangio - 1951, 1954-1957', 'Many consider him to be the greatest driver of all time. In seven full Formula One seasons (he missed one recovering from a nearly fatal injury) he was World Champion five times (with four different teams) and runner-up twice. In his 51 championship Grands Prix he started from the front row 48 times (including 29 pole positions) and set 23 fastest race laps en route to 35 podium finishes, 24 of them victories. His superlative track record was achieved by some of the greatest displays of skill and daring eve', '', 0),
(2948, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10152_20141127_was-arnie-now-barney', 'Was Arnie now Barney from Canterbury | Dogs Trust', '', '', 0),
(2949, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10151_20141127_alfie', 'Alfie from Shoreham | Dogs Trust', '', '', 0),
(2950, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Alberto_Ascari.html', 'Alberto Ascari - 1952, 1953', 'The son of one of Italy&#39;s great pre-war drivers, Alberto Ascari went on to become one of Formula One racing&#39;s most dominant and best-loved champions. Noted for the careful precision and finely-judged accuracy that made him one of the safest drivers in a most dangerous era, he was also notoriously superstitious and took great pains to avoid tempting fate. But his unexplained fatal accident - at exactly the same age as his fatherâ€™s, on the same day of the month and in eerily similar circumstances - ', '', 0),
(2951, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10150_20141127_guy-and-camilla', 'Guy and Camilla from Leeds | Dogs Trust', '', '', 0),
