(2960, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10142_20141127_cooper', 'Cooper from Shoreham | Dogs Trust', '', '', 0),
(2961, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Jack_Brabham.html', 'Jack Brabham - 1959, 1960, 1966', 'Jack Brabham&#39;s three world championships were the product of both his engineering expertise and driving skill. His first two titles, in rear-engined Coopers he helped develop, confirmed the obsolescence of front-engined Formula One cars. His third title, in a Brabham, made him the only driver to become champion in a car of his own make. For his lifetime achievements, which also included nurturing the talents of other notable drivers and pioneering the business side of the sport, he became the first Form', '', 0),
(2962, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10141_20141127_meg-formerly-zara', 'Meg formerly Zara from Kenilworth | Dogs Trust', '', '', 0),
(2963, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10140_20141127_archie-rosie', 'Archie & Rosie from Loughborough | Dogs Trust', '', '', 0),
(2964, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10139_20141127_izzy', 'Izzy from Salisbury | Dogs Trust', '', '', 0),
