(2966, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10137_20141127_roxy', 'Roxy from Shrewsbury | Dogs Trust', '', '', 0),
(2967, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Phil_Hill.html', 'Phil Hill - 1961', 'The first American to become World Champion had a love/hate relationship with the sport. Profoundly intelligent and deeply sensitive, he was also remarkably candid about personal demons that caused inner turmoil and made his racing life a bittersweet experience. He was always fearful and throughout his career he struggled to find a balance between the perils and pleasures of his profession. Yet driving became a way of expressing himself and racing took him on a journey to places he never expected to go.', '', 0),
(2968, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10136_20141127_colin', 'Colin from London (Harefield) | Dogs Trust', '', '', 0),
