(2972, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10132_20141127_george', 'George  from Evesham | Dogs Trust', '', '', 0),
(2973, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Graham_Hill.html', 'Graham Hill - 1962, 1968', 'Graham Hill&#39;s iron-willed determination, fierce pride and great courage enabled him to overcome the odds against more naturally gifted drivers. None of them was more popular with the public than the moustachioed extrovert with the quick wit, who loved the limelight, was a natural entertainer and became one of the first Formula One media stars. His fans remained loyal, even when he damaged his reputation by racing too long past his prime. Millions were shocked when he was killed, not in a racing car, but', '', 0),
(2974, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10131_20141126_mia', 'Mia from Glasgow | Dogs Trust', '', '', 0),
(2975, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10130_20141126_royson', 'ROYSON from Ilfracombe | Dogs Trust', '', '', 0),
