(2978, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10127_20141126_minnie', 'Minnie from Merseyside | Dogs Trust', '', '', 0),
(2979, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Jim_Clark.html', 'Jim Clark - 1963, 1965', 'He never intended to make racing a way of life, let alone become the best in the world in a sport that for him began as farm boy&#39;s hobby. And when the sport took Jim Clark&#39;s life the racing world mourned the loss of one of its best-loved champions, the unassuming Scottish driving genius whose personal integrity and admirable human qualities endeared him to fans and rivals alike. Nearly invincible in the car, he seemed vulnerable out of it and was always a reluctant hero. Few champions were as domina', '', 0),
