(2986, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/John_Surtees.html', 'John Surtees - 1964', 'Famed as the only World Champion on both two and four wheels, John Surtees rode motorcycles and drove Formula One cars with equal skill and bravery. He made the leap from bikes to cars with surprising ease, though his quick climb to the pinnacle of motorsport was also the result of a great deal of hard effort by a serious-minded driver whose fierce independence ultimately proved to be a handicap. Having won the driving title at Ferrari, he left after a violent argument and was thereafter ill-equipped to win', '', 0),
(2987, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10120_20141126_dennis', 'Dennis from Darlington | Dogs Trust', '', '', 0),
(2988, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10119_20141126_wilf-bewster', 'Wilf (Bewster) from Darlington | Dogs Trust', '', '', 0),
