(2992, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Denny_Hulme.html', 'Denny Hulme - 1967', 'Denny Hulme&#39;s dislike of celebrity and preference for anonymity made him the most low key of champions. He hated fame, had no trace of vanity and found social functions an agony. His nickname &#39;The Bear&#39; was a reference to both his rugged features and a gruff nature that would erupt when he was provoked. Yet he was also a sensitive man unable to express his feelings, except in a racing car, in which he was an accomplished if unspectacular driver. He eventually died behind the wheel, a quarter of ', '', 0),
(2993, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10115_20141126_ty-bo', 'Ty & Bo from Ballymena (N.Ireland) | Dogs Trust', '', '', 0),
(2994, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10114_20141126_oscar', 'Oscar from Glasgow | Dogs Trust', '', '', 0),
(2995, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Jackie_Stewart.html', 'Jackie Stewart - 1969, 1971, 1973', 'His outstanding track record still ranks him among the most successful champions, yet in terms of personally influencing the way Formula One racing developed Jackie Stewart stands alone. His one-man safety crusade made the sport much safer. His excellent communication skills helped make it more popular. He set new standards of professionalism for drivers and was also a pioneer in exploiting Formula One racing&#39;s commercial potential. His keen intelligence and tireless energy helped, but he would never ha', '', 0),
(2996, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10113_20141126_lulu-lucy', 'Lulu (lucy) from Loughborough | Dogs Trust', '', '', 0),
(2997, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10112_20141126_toby-and-koda', 'Toby and Koda from Loughborough | Dogs Trust', '', '', 0),
(2998, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10111_20141126_max', 'Max from London (Harefield) | Dogs Trust', '', '', 0),
(2999, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Jochen_Rindt.html', 'Jochen Rindt - 1970', 'In the record books he is notable for being the only posthumous World Champion. But before he was killed Jochen Rindt had carved himself a memorable niche in the small but select category of heroes whose voracious appetite for raw racing was demonstrably apparent in a daredevil driving style that was both thrilling and worrying to watch. Few threw themselves into the fray with such vigour, nor did many measure up to Rindt&#39;s status as a colourful character. Fiercely determined and resolutely independent,', '', 0),
(3000, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10110_20141126_millie-mylo', 'Millie & Mylo from Glasgow | Dogs Trust', '', '', 0),
(3001, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10109_20141126_willow', 'willow  from Bridgend | Dogs Trust', '', '', 0),
(3002, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10108_20141126_ruth', 'ruth from Canterbury | Dogs Trust', '', '', 0),
(3003, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10107_20141126_penny-molly', 'Penny & Molly from Shrewsbury | Dogs Trust', '', '', 0),
(3004, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10106_20141126_harris', 'Harris from Glasgow | Dogs Trust', '', '', 0),
(3005, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10105_20141126_shep', 'Shep from Leeds | Dogs Trust', '', '', 0),
(3006, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Emerson_Fittipaldi.html', 'Emerson Fittipaldi - 1972, 1974', 'The youngest World Champion at the time achieved that distinction through circumstances that threw him in at the deep end while he was still relatively wet behind the ears. But &#39;Emmo&#39; rose superbly to the challenge, winning his first driving title at 25 and his second two years later. Thereafter, dragged under by a disastrous career move, he sank to the bottom leaving hardly a trace of past glory. Yet his status as a popular champion and spokesman for the sport remains intact and he is also credited', '', 0),
(3007, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10104_20141126_verdi', 'Verdi from Salisbury | Dogs Trust', '', '', 0),
(3008, 'https://www.dogstrust.org.uk/rehoming/success-stories/ss_10103_20141126_olly', 'Olly from Shrewsbury | Dogs Trust', '', '', 0),
(3009, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Niki_Lauda.html', 'Niki Lauda - 1975, 1977, 1984', 'He bought his way into Formula One racing and very nearly paid for it with his life. Given up for dead after an appalling accident he recovered by what the medical profession called sheer force of will. His astonishingly quick return to the cockpit was called the most courageous comeback in sporting history. After winning two championships he got bored and left the sport, only to return again and win another. During his remarkable career he was called both a hero and a villain. The battle-scarred champion w', '', 0),
(3010, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/James_Hunt.html', 'James Hunt - 1976', 'James Hunt&#39;s was a turbulent life lived to the limit - in and out of racing cars. As a driver he overcame constant fear and enormous odds to become the best in the world - triumphing in one of the most dramatic championship battles in Formula One history. As a colourful personality and unconventional character he had no peers - alternately entertaining admirers and offending critics with his often outrageous behaviour. After he retired he continued to make a strong impact, as a TV commentator, but died ', '', 0),
(3011, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Mario_Andretti.html', 'Mario Andretti - 1978', 'Mario Andretti personified the American Dream, an immigrant who came to the land of the free and the home of the brave and achieved considerable fame and fortune. He did so in a job he would have done in anonymity and for nothing. Few drivers loved their racing more, and few suited stardom as much as the congenial man whose unforced charm was as natural as the talent that brought him so much success in so many types of racing. His insistence on racing in his adopted homeland meant he came late to realising ', '', 0),
(3012, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Jody_Scheckter.html', 'Jody Scheckter - 1979', 'He exploded on the scene as an erratic, crash-prone wild man whose desperate deeds of derring-do put himself and his peers in great danger. Jody Scheckter became infamous for causing one of the biggest accidents in Formula One history, after which there were demands that he should be banned from the sport. Instead, he straightened himself out and concentrated his considerable talent and ambition on becoming World Champion. Having achieved his goal (with Ferrari, whose next champion would be 21 years in the ', '', 0),
(3013, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Alan_Jones.html', 'Alan Jones - 1980', 'A straight-talking, iron-willed, hard-driving tough guy, Alan Jones fought his way to the forefront, where he defended his territory with ruthless determination and large doses of intimidation. His belligerence was partly a by-product of a long and hard struggle to make it to Formula One racing in the first place. Once there, he was considered little more than a journeyman driver, until he teamed up with the then equally undistinguished Williams team. Together, they took on the world and beat it, with AJ be', '', 0),
(3014, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Nelson_Piquet.html', 'Nelson Piquet - 1981, 1983, 1987', 'He was never a dominant driver but a crafty expert in winning by stealth, according to his detractors. He admitted he was lazy, yet willingly worked hard to improve his car. He could be cold and cruel but could also be warm and funny. He hated being a celebrity yet lived the life of a playboy to the hilt. He was never hugely popular but couldn&#39;t care less. All Nelson Piquet really cared about was driving a racing car, which he loved with a passion, especially when he won, which he did often enough to be', '', 0),
(3015, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Keke_Rosberg.html', 'Keke Rosberg - 1982', 'The original Flying Finn was a swaggering swashbuckler whose dashing, daring, darting style of driving enlivened every race he was in. He was a late arrival in Formula One racing, having wheeled and dealed and raced his way around the world in other categories for a dozen years, but tried harder than ever to make up for lost time. In the record books his name is not near the top in terms of Grand Prix victories, yet in that select category of those who actually looked as fast as they drove the wonderfully a', '', 0),
(3016, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Alain_Prost.html', 'Alain Prost - 1985, 1986, 1989, 1993', 'His place in Formula One history as one of the sport&#39;s greatest drivers is secure, though a career full of conflict and controversy detracted somewhat from his considerable achievements. He won four championships but also left teams acrimoniously on four occasions. He made winning races - 51 times - look easy but was less successful at the politics in which he was invariably embroiled. His bitter feud with Ayrton Senna brought out the best and worst in them both. And yet among the champions only Michael', '', 0),
(3017, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Ayrton_Senna.html', 'Ayrton Senna - 1988, 1990, 1991', 'He streaked through the sport like a comet, an other-worldly superstar whose brilliance as a driver was matched by a dazzling intellect and coruscating charisma that illuminated Formula One racing as never before. No one tried harder or pushed himself further, nor did anyone shed so much light on the extremes to which only the greatest drivers go. Intensely introspective and passionate in the extreme, Ayrton Senna endlessly sought to extend his limits, to go faster than himself, a quest that ultimately made', '', 0),
(3018, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Nigel_Mansell.html', 'Nigel Mansell - 1992', 'No driver fought harder to get into Formula One racing and few fought harder when they got there. Hugely determined, immensely aggressive and spectacularly daring, he was one of the most exciting drivers ever. With his win or bust approach - 31 wins and 32 crashes - he became the most successful British driver and joined the ranks of the all-time greats in terms of fastest laps, wins and poles. With the Union Jack on his helmet and a chip on his shoulder, he was both quick and controversial. His awkward per', '', 0),
(3019, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Michael_Schumacher.html', 'Michael Schumacher - 1994, 1995, 2000-2004', 'Since the Formula One World Drivers&#39; Championship began in 1950 the title has been won by 32 different drivers, 15 of whom won more than one championship. Of the multiple champions the most prolific was Juan Manuel Fangio, whose record of five titles stood for five decades until it was eclipsed by the most successful driver in the sport&#39;s history. Seven times a champion, Michael Schumacher also holds nearly every scoring record in the book by a considerable margin. Though his ethics were sometimes q', '', 0),
(3020, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Damon_Hill.html', 'Damon Hill - 1996', 'When Williams made Damon Hill a Formula One driver, despite his undistinguished racing record, Frank Williams said it was because he was &#34;a tough bastard&#34; and Patrick Head said he admired his &#34;fierce inner determination.&#34; Like his World Champion father Graham Hill, he needed these qualities to achieve ultimate success in the sport to which - also like his father - he came late after a long struggle. His heritage helped, as did luck, but in the end it was his own ability that enabled Damon Hi', '', 0),
(3021, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Jacques_Villeneuve.html', 'Jacques Villeneuve - 1997', 'Judging by the record books Jacques Villeneuve had a Formula One career in reverse. He nearly won the driving title in his debut year, did so in his second season, then went steadily downhill and eventually dropped right out of the sport. Yet the statistical rise and fall of the son of one of the greatest racing heroes was not an accurate reflection of his driving ability, nor do the numbers do justice to his impact as one of the most colourful and controversial champions. As a distinctive personality he st', '', 0),
(3022, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Mika_Hakkinen.html', 'Mika Hakkinen - 1998, 1999', 'He never said much, preferring to let his driving speak for itself. And it spoke volumes for the laid-back Flying Finn who always drove flat out. Everybody liked the silent star and nobody begrudged the success of the brave man who was nearly killed before he achieved it. Consistent as well as quick, he scored points in over half his races, taking his lop-sided grin to the top of the podium on 20 occasions. In their 11 years as rivals the only driver who achieved more was Michael Schumacher, who said the op', '', 0),
(3023, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Fernando_Alonso.html', 'Fernando Alonso - 2005, 2006', 'The 28th Formula One World Drivers&#39; Champion was at the time the youngest ever. Just 24 years old, Fernando Alonso also led the Renault team to the 2005 Constructors&#39; Championship, thus ending the reign of the Michael Schumacher-Ferrari combination that had dominated for so long. The precocious and personable youngster who made so much history so soon comfortably wore the crown - a bright, polished, perfectly poised new star. Confirmation of his brilliance came in 2006 when he successfully defended ', '', 0),
(3024, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Kimi_Raikkonen.html', 'Kimi Raikkonen - 2007', 'Fast-tracked into the sport with the shortest CV on four wheels, the unknown newcomer who came from nowhere and said next to nothing immediately proved he knew exactly what he was doing: driving a Formula One car as fast as it could possibly go. The car couldn&#39;t always keep up with his talent and it took seven seasons for Kimi &#39;Iceman&#39; Raikkonen to become World Champion. Notoriously inanimate and uncommunicative, the silent speedster&#39;s frozen expression in fact masked the hidden depths in on', '', 0),
(3025, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Lewis_Hamilton.html', 'Lewis Hamilton - 2008, 2014, 2015, 2017', 'The 30th Formula One World Champion was the youngest ever, taking the title in the most dramatic fashion - on the last corner of the last lap of the last race of one of the most scintillating seasons. The sensational triumph of the sport&#39;s first black driver, in only his second year at the pinnacle of motorsport, was a welcome human interest story that focused unprecedented international attention on Formula One racing. His prodigious talent and pleasing personality made Lewis Hamilton an inspirational ', '', 0),
(3026, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Jenson_Button.html', 'Jenson Button - 2009', 'The 2009 World Champion grew up in the sport, maturing from a carefree youngster distracted by having too much too soon into a seasoned survivor who toiled in obscurity for a decade before his perseverance suddenly paid off in a fairy tale finish with a team that came from nowhere. His unexpected title triumph was partly the product of circumstances that prevented other contenders from overcoming his sensational head start, but ultimately it was Jenson Button&#39;s talent and tenacity that took him to the t', '', 0);
