(3027, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Sebastian_Vettel.html', 'Sebastian Vettel - 2010-2013', 'The youngest ever world champion&#39;s accumulation of age-related records that began in 2010 continued for four consecutive seasons, culminating in a one-sided 2013 title triumph that confirmed his status as one of the sportâ€™s all-time greats. Sebastian Vettelâ€™s first championship, at the age of 23, provided a surprise ending to an intensely competitive 2010 campaign. There was surely more to come from this fast rising racer, and it came quickly when he completely dominated in 2011 to become the younge', '', 0),
(3028, 'http://www.formula1.com/en/championship/drivers/hall-of-fame/Nico_Rosberg.html', 'Nico Rosberg - 2016', 'When he was just six years old Nico Rosberg decided he was going to emulate his famous father and become a Formula One World Champion. It seemed a far-fetched fantasy, even for a boy benefitting from a privileged upbringing in Monaco. Indeed it took 25 years of hard effort for Nico to make his childhood dream come true. His championship quest took a heavy toll, prompting a final twist in the tale of triumph. Five days after taking the title, in a dramatic last-race showdown with his team mate Lewis Hamilton', 'Nico Rosberg,', 0),
