(3038, 'http://www.formula1.com/en/latest/headlines/2018/6/vettel-_-red-bull-will-be-dangerous-in-canada-.html', 'Vettel â€“ Red Bull will be dangerous again in Canada ', 'They dominated on the tight and twisty streets of Monaco last time out, and according to Ferrariâ€™s Sebastian Vettel, Red Bull will be right in the mix for victory again in Canada, despite the very different track layout. ', 'Canada,Red Bull,Ferrari,Sebastian Vettel,', 0),
