(3042, 'http://www.formula1.com/en/latest/headlines/2018/6/ricciardo-set-to-avoid-grid-penalty-in-canada.html', 'Ricciardo set to avoid grid penalty in Canada', 'Daniel Ricciardoâ€™s hopes of a strong result in Canada have been given a welcome boost by the news that heâ€™s set to avoid taking a grid penalty for engine component changes after allâ€¦', 'Daniel Ricciardo,Red Bull,Canada,', 0),
(3043, 'http://www.formula1.com/en/latest/headlines/2018/6/ricciardo-set-for-canadian-gp-grid-penalty.html', 'Ricciardo set for Canadian GP grid penalty', 'Daniel Ricciardo usually wins the hard way â€“ and thatâ€™s exactly what heâ€™ll have to do if he is to triumph in Canada this weekend, with the news that the Red Bull driver is set to take a grid penalty.', 'Daniel Ricciardo,Red Bull,', 0),
(3044, 'http://www.formula1.com/en/latest/headlines/2018/6/ricciardo-now-part-of-three-way-title-fight---hamilton.html', 'Ricciardo now part of three-way title fight - Hamilton', 'Red Bull havenâ€™t had consistently good results this season but Daniel Ricciardoâ€™s two wins â€“ in China and Monaco - make him a real title contender in the eyes of Mercedes rival Lewis Hamilton...', 'Daniel Ricciardo,Lewis Hamilton,', 0),
