(3053, 'http://www.formula1.com/en/latest/headlines/2018/6/mercedes-there-or-there-abouts-in-montreal---bottas.html', 'Bottas - Mercedes \'there or there abouts\' in Montreal', 'A quick glance at the FP2 timesheets in Canada might lead you to think that Mercedes â€“ who wound up the session with Lewis Hamilton in fourth and Valtteri Bottas in sixth â€“ were on the back foot for the second consecutive race. But that doesnâ€™t quite tell the full storyâ€¦', 'Mercedes,Valtteri Bottas,Canada,', 0),
(3054, 'http://www.formula1.com/en/latest/features/2018/6/what-the-teams-said---practice-in-canada.html', 'What the teams said - practice in Canada', 'A round-up of the opening day&#39;s events from the Formula 1 Grand Prix Heineken du Canada 2018 at the Circuit Gilles-Villeneuve...', 'Mercedes,Force India,McLaren,Pirelli,Renault,Williams,Red Bull,Ferrari,Toro Rosso,Sauber,Haas,', 0),
