(3068, 'http://www.formula1.com/en/championship/drivers/kimi-raikkonen/Biography.html', 'Kimi Raikkonen Biography', '&#34;Heâ€™s a man of few words,â€ Jenson Button once said of Kimi Raikkonen, â€œbut he&#39;s all about racing.&#34; Never the most loquacious out of the car, the mercurially-talented 2007 world champion has always preferred to let his driving do the talking, be that in a rally car, on a snowmobile, or, most successfully, in Formula 1 machinery.', 'Kimi Raikkonen,', 0),
