(3101, 'http://www.formula1.com/en/championship/inside-f1/rules-regs/Television_cameras_and_timing_transponders.html', 'Television cameras and timing transponders', 'Television cameras and timing transponders', '', 0),
(3102, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Aerodynamics.html', 'Aerodynamics', 'Ask any engineer in the pit lane and theyâ€™ll tell you that the most important consideration in F1 car design - the difference between designing a championship-challenging machine or a tail ender - is aerodynamics.', '', 0),
(3103, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Brakes.html', 'Brakes', 'When it comes to the business of slowing down, Formula 1 cars are surprisingly closely related to their road-going cousins. Indeed as ABS anti-skid systems have been banned from Formula 1 racing, most modern road cars can lay claim to having considerably cleverer retardation.', '', 0),
(3104, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Cornering.html', 'Cornering', 'Cornering is vital to the business of racing cars, and Formula 1 is no exception. Itâ€™s in the corners where a driverâ€™s skill becomes more immediately apparent; where an ace pilot can extract the tiny advantage that makes the difference between winning and losing.', '', 0),
(3105, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Energy_Recovery_Systems.html', 'Power unit and ERS', 'The internal combustion engine has always been the beating heart of a Formula 1 car, though today it represents just one element of an enormously sophisticated power unit.', '', 0),
(3106, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Overtaking_and_the_DRS.html', 'Overtaking and the DRS', 'As only one driver can ever sit on pole position for a race, and the entire grid wants to finish on the top step of the podium, overtaking is of vital importance to the business of racing. Simplified to its most basic form, overtaking is nothing more than gaining track position by getting past an opponent.', '', 0),
(3107, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Flags.html', 'Flags', 'Marshals at various points around the circuit are issued with a number of standard flags, all used to communicate vital messages to the drivers as they race around the track. A special display in each driverâ€™s cockpit - known as a GPS marshalling system - also lights up with the relevant flag colour, as the driver passes the affected section of track. ', '', 0),
(3108, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Pit_stops.html', 'Pit stops', 'Drivers get most of the attention, but Formula 1 racing remains a team sport even during the race itself. The precisely timed, millimetre perfect choreography of a modern pit stop is vital to help teams to turn their race strategy into success - changing a carâ€™s tyres, replacing damaged parts and adjusting front wings in a matter of seconds.', '', 0),
(3109, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/power-unit---gearbox.html', 'Gearbox', 'Changing gears in a Formula 1 car is very much a fingertip exercise - drivers simply flick a paddle behind the steering wheel to change sequentially up or down.', '', 0),
(3110, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Race_control.html', 'Race control', 'During a Grand Prix weekend, race control lies at the very heart of Formula 1, responsible for monitoring and supervising all stages of the practice, qualifying and race sessions.', '', 0),
(3111, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Steering_wheel.html', 'Steering wheel', 'The steering wheel is the critical interface between driver and car. From here, through the use of various switches, buttons and dials, he can make numerous changes to his machine - all without ever having to lift off the throttle.', '', 0),
(3112, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Tyres.html', 'Tyres', 'A modern Formula 1 car is a technical masterpiece. But considering the development effort invested in aerodynamics, composite construction and engines it is easy to forget that tyres are still a race carâ€™s biggest single performance variable and the only point of contact between car and track.', '', 0),
(3113, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Race_strategy.html', 'Race strategy', 'Part science, part dark art - a decent strategy is essential to the business of winning races. Or, indeed, losing them. The basic variables of the equation are simple enough: fuel load and tyre wear. But from then on, it gets vastly more complicated.', '', 0),
(3114, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Suspension.html', 'Suspension', 'The suspension of a modern Formula 1 car forms the critical interface between the different elements that work together to produce its performance. Suspension is what harnesses the power of the power unit, the downforce created by the wings and the grip of the tyres, and allows them all to be combined effectively and translated into a fast on-track package.', '', 0),
(3115, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/The_race_start.html', 'The race start', 'There are few moments in sport more exhilarating than the start of a Grand Prix. As the drivers arrive in their grid positions and begin to furiously rev their engines, all of them have one thought in mind - to get to the first corner as quickly as possible. ', '', 0),
(3116, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Testing.html', 'Testing', 'As Formula 1 racing grew ever more technically demanding, so the practice of testing grew in importance. The old principle of tinkering with an instinctively designed car has long since been superseded by systematic testing of every major component and structure - both before and after the car is fully built and ready to race.', '', 0),
(3117, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Fuel.html', 'Fuel', 'Surprising but true, despite the vast amounts of technical effort spent developing a Formula 1 car, the fuel it runs on is surprisingly close to the composition of ordinary, commercially available petrol.', '', 0),
(3118, 'http://www.formula1.com/en/championship/inside-f1/understanding-f1-racing/Logistics.html', 'Logistics', 'For Formula 1 teams one of the biggest battles of a race weekend or testing session will be over before a car even turns a wheel: the vast logistical effort required to get all of the team&#39;s equipment to the circuit - so vast, in fact, that F1 has its very own Official Logistics Partner, DHL.', '', 0),
(3119, 'http://www.formula1.com/en/championship/awards/driver-of-the-day-2017.html', 'Driver of the Day 2017', 'Introduced in 2016, the Driver of the Day award is voted for by fans during each Grand Prix and announced at the end of the race.', '', 0),
